import React, { useState, useEffect } from 'react';
import { View, Text, TouchableOpacity, Modal } from 'react-native';
import { useNavigation } from '@react-navigation/native';
import { styles } from '../styles/workoutSelectionModalStyles';
import MuscleGroupSelectionModal from './MuscleGroupSelectionModal';
import AsyncStorage from '@react-native-async-storage/async-storage';
import { Ionicons } from '@expo/vector-icons';

const WorkoutSelectionModal = ({ visible, onClose }) => {
  const navigation = useNavigation();
  const [isMuscleGroupModalVisible, setIsMuscleGroupModalVisible] = useState(false);
  const [presets, setPresets] = useState([]);
  const [presetsModalVisible, setPresetsModalVisible] = useState(false);

  // Load presets from AsyncStorage
  useEffect(() => {
    const loadPresets = async () => {
      const data = await AsyncStorage.getItem('workout_presets');
      if (data) setPresets(JSON.parse(data));
    };
    loadPresets();
  }, []);

  const handleAddExercise = () => {
    setIsMuscleGroupModalVisible(true);
  };

  const handleSelectRoutine = () => {
    onClose();
    navigation.navigate('SelectRoutine');
  };

  const handlePresetSelect = (preset) => {
    setPresetsModalVisible(false);
    onClose();
    navigation.navigate('ConfigureWorkout', { exercises: preset.exercises, workoutName: preset.name });
  };

  const handleMuscleGroupSelect = (muscleGroup) => {
    setIsMuscleGroupModalVisible(false);
    onClose();
    navigation.navigate('AddExercise', { muscleGroup: muscleGroup.name, muscleGroupId: muscleGroup.id });
  };

  return (
    <>
      <Modal
        animationType="slide"
        transparent={true}
        visible={visible}
        onRequestClose={onClose}
      >
        <View style={styles.modalOverlay}>
          <View style={styles.modalContent}>
            <Text style={styles.modalTitle}>Choose Workout Type</Text>

            <TouchableOpacity
              style={styles.modalButton}
              onPress={handleAddExercise}
            >
              <Text style={styles.modalButtonText}>Add Exercise</Text>
            </TouchableOpacity>

            <TouchableOpacity
              style={styles.modalButton}
              onPress={handleSelectRoutine}
            >
              <Text style={styles.modalButtonText}>Select Routine</Text>
            </TouchableOpacity>

            {/* Load Preset Button */}
            <TouchableOpacity
              style={styles.modalButton}
              onPress={() => setPresetsModalVisible(true)}
            >
              <Ionicons name="flash-outline" size={20} color="#6b46c1" style={{ marginRight: 8 }} />
              <Text style={styles.modalButtonText}>Load Preset</Text>
            </TouchableOpacity>

            <TouchableOpacity
              style={styles.closeButton}
              onPress={onClose}
            >
              <Text style={styles.closeButtonText}>Cancel</Text>
            </TouchableOpacity>
          </View>
        </View>
      </Modal>

      {/* Modal for selecting a preset */}
      {presetsModalVisible && (
        <View style={{
          position: 'absolute',
          top: 0, left: 0, right: 0, bottom: 0,
          backgroundColor: 'rgba(0,0,0,0.5)',
          justifyContent: 'center', alignItems: 'center', zIndex: 1000
        }}>
          <View style={{ backgroundColor: '#fff', borderRadius: 16, padding: 24, minWidth: '80%', maxHeight: '80%' }}>
            <Text style={{ fontSize: 20, fontWeight: 'bold', color: '#6b46c1', marginBottom: 12 }}>Select a Preset</Text>
            {presets.length === 0 ? (
              <Text style={{ color: '#666', marginBottom: 12 }}>No presets found.</Text>
            ) : (
              presets.map((preset) => (
                <TouchableOpacity
                  key={preset.id}
                  style={{ padding: 16, borderBottomWidth: 1, borderBottomColor: '#eee' }}
                  onPress={() => handlePresetSelect(preset)}
                >
                  <Text style={{ fontSize: 16, color: '#222' }}>{preset.name}</Text>
                </TouchableOpacity>
              ))
            )}
            <TouchableOpacity style={{ marginTop: 18, alignSelf: 'flex-end' }} onPress={() => setPresetsModalVisible(false)}>
              <Ionicons name="close" size={28} color="#888" />
            </TouchableOpacity>
          </View>
        </View>
      )}
      <MuscleGroupSelectionModal
        visible={isMuscleGroupModalVisible}
        onClose={() => setIsMuscleGroupModalVisible(false)}
        onSelectMuscleGroup={handleMuscleGroupSelect}
      />
    </>
  );
};

export default WorkoutSelectionModal;
